  <div id="game-box"></div>

  <script>
    const gameBox = document.getElementById("game-box");

    const scenes = {
      start: {
        text: `당신은 폐쇄된 병원의 야간 청소 알바를 시작한 지 일주일째다.

병동 3층, 이른바 'C 구역'은 감염관리 구역이라며 접근 금지 구역으로 분류돼 있다.

그런데 오늘은 C 구역의 문이 열려 있다.
당신은 문 앞에 멈춰선다. 열쇠는 없었다. 그 문은 원래 열리지 않는다.`,
        choices: [
          { text: "1. 안으로 들어간다.", next: "inRoom" },
          { text: "2. 병원 관리자에게 연락한다.", next: "callManager" },
        ],
      },
      inRoom: {
        text: `당신은 무심코 문을 밀고 들어간다. 먼지 쌓인 복도. 켜지지 않는 형광등. 끊긴 CCTV.

아무도 없어야 할 곳인데… 복도 끝의 문이 닫힌다. "찰칵."

책상 위에 놓인 종이 한 장.

\"<span class='red'>청소는 끝났습니다. 이제 그만 떠나세요.</span>\"`,
        choices: [
          { text: "1-1. 메모를 챙긴다.", next: "endingC" },
          { text: "1-2. 소리가 난 복도 끝으로 간다.", next: "endingB" },
        ],
      },
      callManager: {
        text: `관리자 번호로 전화를 건다. 연결음만 반복된다.

삐. 자동 응답.
<span class='red'>"C 구역은 비워 두세요. 누군가 이미 있습니다."</span>

순간 당신의 뒤에서 문이 열린다. 아무도 없던 C 구역 안쪽에서
희미한 불빛이 깜빡인다.

당신은 돌아서 병원을 빠져나온다.
이후, 병원은 철거됐다.

하지만, 당신은 가끔 TV에서 그 장면을 본다. CCTV 속, 자기 자신이 복도를 청소하고 있는 모습.

<span class='red'>"비워 두세요."</span> 그 말의 뜻이 점점 선명해진다.<br><br><button class='choice' onclick='renderScene("start")'>↺ 처음으로 돌아가기</button>`,
        choices: [],
      },
      endingB: {
        text: `복도 끝의 문을 열자, 그 안은 텅 빈 컨테이너.
안에는 낡은 청소복 한 벌, 그리고 이름표.

이름은… 당신의 이름이다.

뒤에서 인기척. 당신은 돌아본다. 아무도 없다. 하지만 무언가 서늘하게 스쳐 간다.

그 순간, 당신은 기억한다. 이 병원에 오기 전, 당신은 환자였다.

컨테이너 문이 닫힌다. 다시 열리지 않는다.<br><br><button class='choice' onclick='renderScene("start")'>↺ 처음으로 돌아가기</button>`,
        choices: [],
      },
      endingC: {
        text: `메모 뒷면엔 익숙한 필체.
<span class='red'>"CCTV는 가짜야. 시키는 대로만 하면 넌 안전해."</span>

그 순간 당신은 생각난다.
한 달 전, 병원장이 내민 계약서.
"이 병원은 사람을 잊게 만들어. 그게 청소야."

문득 전화기가 울린다. 당신은 수화기를 든다.
<span class='red'>"다시 시작해요. 다음 사람을 맞이할 시간이에요."</span>

화면이 검게 꺼진다.<br><br><button class='choice' onclick='renderScene("start")'>↺ 처음으로 돌아가기</button>`,
        choices: [],
      },
    };

    function renderScene(sceneKey) {
      const scene = scenes[sceneKey];
      gameBox.innerHTML = `<div>${scene.text}</div>`;
      scene.choices?.forEach((choice) => {
        const btn = document.createElement("button");
        btn.textContent = choice.text;
        btn.className = "choice";
        btn.onclick = () => renderScene(choice.next);
        gameBox.appendChild(btn);
      });
    }

    renderScene("start");
  </script>
